import React from "react";
import Header from "./components/Header";
import BrandingSettings from "./components/BrandingSettings";

function App() {
  return (
    <div>
      <Header />
      <main className="p-4">
        <BrandingSettings />
      </main>
    </div>
  );
}

export default App;
